{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/jeffransenar/cyclistic-bikeshare?scriptVersionId=123881060\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"---\ntitle: \"A Case Study: Cyclistic Bike-share Analysis\"\nauthor: \"Jeffran Senar\"\ndate: \"2023-03-17\"\noutput: html_document\n---\n\n# Table of Contents\n\n* [Introduction]\n* [Scenario] \n* [Step 1: Ask Phase]\n* [Step 2: Prepare Phase]\n* [Step 3: Process Phase]\n* [Step 4: Analyze Phase] \n* [Step 5: Share Phase]\n* [Step 6: Act Phase] \n* [Reflection]\n* [Resources]\n\n\n\n","metadata":{}},{"cell_type":"markdown","source":"## Introduction \n\nHello, my name is Jeffran I. Señar. This is the Capstone Project for the Google Data Analytics Professional Certificate of the Coursera Program. The steps I used here are from the course framework, and they are as follows: Ask, Prepare, Process, Analyze, Share, and Act. The title of this project is \"The Cyclistic Bikeshare Analysis\".","metadata":{}},{"cell_type":"markdown","source":"## Scenario\n\nI will be acting as a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, my team wants to understand how casual riders and annual members use Cyclistic bikes differently. From the insights, our team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve our recommendations, so they must be backed up with compelling data insights and professional data visualizations. See the license [here](https://ride.divvybikes.com/data-license-agreement). ","metadata":{}},{"cell_type":"markdown","source":"## Step 1: Ask Phase\n\n#### Knowing the Company\nDivvy's Cyclistic Bikeshare is a program of the Chicago Department of Transportation (CDOT), which owns the city’s bikes, stations and vehicles. Initial funding for the program came from federal grants for projects that promote economic recovery, reduce traffic congestion and improve air quality, as well as additional funds from the City’s Tax Increment Financing program. In 2016, Divvy expanded to the neighboring suburb of Evanston with a grant from the State of Illinois.\n\nCDOT’s mission is to keep the city’s surface transportation networks and public ways safe for users, environmentally sustainable and in a state of good repair and attractive, so that its diverse residents, businesses and guests can all enjoy a variety of quality transportation options, regardless of ability or destination.\n\nIn 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.\n\nUntil now, Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments. One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n\nCyclistic’s finance analysts have concluded that annual members are much more profitable than casual riders. Although the pricing flexibility helps Cyclistic attract more customers, Moreno believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, Moreno believes there is a very good chance to convert casual riders into members. She notes that casual riders are already aware of the Cyclistic program and have chosen Cyclistic for their mobility needs.\n\n#### Stakeholders  \n\nMoreno has set a clear goal: Design marketing strategies aimed at converting casual riders into annual members. In order to do that, however, the marketing analyst team needs to better understand how annual members and casual riders differ, why casual riders would buy a membership, and how digital media could affect their marketing tactics. Moreno and her team are interested in analyzing the Cyclistic historical bike trip data to identify trends.\n\n* Cyclistic: A bike-share program that features more than 5,800 bicycles and 600 docking stations. Cyclistic sets itself apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more likely to ride for leisure, but about 30% use them to commute to work each day.\n\n* Lily Moreno: The director of marketing and your manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels. \n\n* Cyclistic marketing analytics team: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy. You joined this team six months ago and have been busy learning about Cyclistic’s mission and business goals, as well as how you, as a junior data analyst, can help Cyclistic achieve them.\n\n* Cyclistic executive team: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program.\n\n#### Three questions will guide the future marketing program:\n1. How do annual members and casual riders use Cyclistic bikes differently?\n2. Why would casual riders buy Cyclistic annual memberships?\n3. How can Cyclistic use digital media to influence casual riders to become members?\n\nMoreno has assigned me to the first question which is: **How do annual members and casual riders use Cyclistic bikes differently?**\n\n#### Moreno is also expected me to produce a report with the following deliverables:\n1. A clear statement of the business task\n2. A description of all data sources used\n3. Documentation of any cleaning or manipulation of data\n4. A summary of your analysis\n5. Supporting visualizations and key findings\n6. Your top three recommendations based on your analysis\n","metadata":{}},{"cell_type":"markdown","source":"## Step 2: Prepare Phase\n\n#### Key tasks: \n1. Download data and store it appropriately. \n2. Identify how it’s organized. \n3. Sort and filter the data.\n\n#### These are the steps I took when preparing data:\n\n1. I download the data for Year 2022 from <link> Cyclistic, specifically for 12 months.\n2. I then unzip the files.\n3. Next, I create a folder on my laptop and use appropriate file-naming conventions to house the files.\n4. I create subfolders for the .CSV file and the .XLS or Sheets file, and move the downloaded files to the correct subfolder.\n5. To open each .CSV file per month, I launch Microsoft Excel.\n6. While trying to combine each .CSV file per month, I notice that there is a constraint in the limit of the required number of rows using a spreadsheet. If all months are combined, it will need around 5 million rows, but Microsoft Excel only allows up to a million rows. This is why I shift to using the R Programming Language.\n7. I use the rbind command in R to combine all the files per month in a .CSV format.\n8. I created columns needed for data cleaning and data analysis. These columns are the following: \n        * Ride Length - I calculate the length of each ride by subtracting the column \"started_at\" from the column \"ended_at\" using the lubridate library.\n        * Month - I use mutate and month command to extract the months from the column \"started_at,\" and then rename the new column as \"month.\"\n        * Day of Week -  I use mutate and wday command to extract the weeks from the column \"started_at,\" and then rename the new column as \"day_of_week.\"\n        * Hour - I use mutate and hour command to extract the hour from the column \"started_at,\" and then rename the new column as \"hour.\"\n        * Season - I converted the months into seasons using mutate and case_when command, and then rename the new column as \"season.\"\n8. Lastly, I uploaded the combined data here in kaggle. \n","metadata":{}},{"cell_type":"code","source":"##### Libraries \n\ninstall.packages(\"tidyverse\")\nlibrary(tidyverse)\nlibrary(readr)\nlibrary(lubridate)\nlibrary(ggplot2)\nlibrary(dplyr)\nlibrary(scales)\nlibrary(gapminder)\ninstall.packages(\"chron\")\nlibrary(chron)\ninstall.packages(\"geosphere\")\nlibrary(geosphere)\nlibrary(knitr)\ninstall.packages(\"Hmisc\")\nlibrary(Hmisc)\nlibrary(grid)","metadata":{"scrolled":true,"_kg_hide-output":true,"execution":{"iopub.status.busy":"2023-03-30T00:30:29.242094Z","iopub.execute_input":"2023-03-30T00:30:29.24421Z","iopub.status.idle":"2023-03-30T00:34:30.927855Z"},"trusted":true},"execution_count":1,"outputs":[{"name":"stderr","text":"Installing package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nWarning message:\n“unable to access index for repository http://cran.rstudio.com/src/contrib:\n  cannot open URL 'http://cran.rstudio.com/src/contrib/PACKAGES'”\nWarning message:\n“package ‘tidyverse’ is not available for this version of R\n\nA version of this package for your version of R might be available elsewhere,\nsee the ideas at\nhttps://c