nt the cleaning process.\n\n#### Deliverable \n* Documentation of any cleaning or manipulation of data\n\nThese are the steps I went through the to secure that the data is clean, free from bias, and outliers. \n1. Remove Duplicate Entries - Ride ID is the unique identifier in this data. By looking through this column help me identify duplicate entries. ","metadata":{}},{"cell_type":"code","source":"#removed duplicated entries based on ride id\nt <- a[!duplicated(a$ride_id), ]\n\n#confirmed duplicated entries using n_distinct\nn_distinct(a$ride_id)","metadata":{"execution":{"iopub.status.busy":"2023-03-30T00:38:06.820161Z","iopub.execute_input":"2023-03-30T00:38:06.821864Z","iopub.status.idle":"2023-03-30T00:38:11.287193Z"},"trusted":true},"execution_count":4,"outputs":[{"output_type":"display_data","data":{"text/html":"4774482","text/markdown":"4774482","text/latex":"4774482","text/plain":"[1] 4774482"},"metadata":{}}]},{"cell_type":"markdown","source":"2.  Filter - Bikes are expected to be used within a 24-hour period. To ensure compliance with this rule, I filtered the data to only include records where the bike was used for more than 0 minutes but less than 1440 minutes. This was done to ensure that the bike was used between the start and end stations within the same day. Any data that showed the bike being used for more than one day or less than a minute was excluded from the analysis.Filter Data - The company states that a bike must be used within a day. With this, I filtered data covering only > 0 minutes to <1440 minutes. This is to ensure that the bike is used within the day from the start station to end station. It exclude data where the bike is used more than a day or less than a minute. ","metadata":{}},{"cell_type":"code","source":"#filter \nu <- t %>% filter(ride_length_mins > 0, ride_length_mins <= 1440)","metadata":{"execution":{"iopub.status.busy":"2023-03-30T00:38:27.681869Z","iopub.execute_input":"2023-03-30T00:38:27.683922Z","iopub.status.idle":"2