AElFTkSuQmCC"},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"markdown","source":"Top 10 Stations on Count of Rides ","metadata":{}},{"cell_type":"code","source":"#Top 10 Starting and Ending Stations on Count of Rides\n\nsc <- cyclist_summary %>% \n  group_by(station = start_station_name, id = start_station_id) %>% \n  summarise(count = length(ride_id)) %>% \n  arrange(desc(count))\n\nec <- cyclist_summary %>% \n  group_by(station = end_station_name, id = end_station_id) %>% \n  summarise(count = length(ride_id)) %>% \n  arrange(desc(count))\n\nscec <- rbind(sc, ec)\n\nscecs <- data.frame(scec) %>% \n    filter(!is.na(station)) %>%\n  group_by(id, station) %>%\n  summarise(count = sum(count)) %>% \n  arrange(desc(count)) %>% \n  head(10)\nscecs\n\n# Define the color palette\ncolor_palette <- colorRampPalette(colors = c(\"#EAA221\", \"#0B0B45\"))\n\nggplot(data = scecs) +\n  geom_col(mapping = aes(x = count, y = reorder(station, count), fill = count)) + \n  scale_fill_gradient(low = \"#EAA221\", high = \"#0B0B45\") +\n  labs(title = \"Number of Rides\", subtitle = \"Top 10 Stations\", x = \"Number of Rides\", y = \"\") + \n  guides(fill = \"none\") + \n  theme(panel.background = element_rect(fill = \"#F8F0E3\"), plot.background = element_rect(fill = \"#F8F0E3\"),\n        legend.position = \"none\")\n\n\nggsave(\"highestridestart.png\")","metadata":{"execution":{"iopub.status.busy":"2023-03-30T00:43:28.728853Z","iopub.execute_input":"2023-03-30T00:43:28.730474Z","iopub.status.idle":"2023-03-30T00:43:32.347098Z"},"trusted":true},"execution_count":31,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`summarise()` has grouped output by 'station'. You can override using the\n`.groups` argument.\n\u001b[1m\u001b[22m`summarise()` has grouped output by 'station'. You can override using the\n`.groups` argument.\n\u001b[1m\u001b[22m`summarise()` has grouped output by 'id'. You can override using the `.groups`\nargument.\n","output_type":"stream"},{"