L+jKbh+9dN6/vs8tElyzZe/Md4WMiS\na1ETdEvUjO26X73447AOtc8f3PnVksg/EuWzv916ZU2fojdu1WTcn4cjejU12r9tw/xVOx6K\nveasjTo6u1UpYyYi96DaRDRmakz+TfXHrju/YZqfbcquyLWrd51x7jfn6pa3D0AuvFMM32Tv\npR2f9fK7e3xf+PzwiM2/mDXvtePU2QG2hT2QBaA8MCzLalUKVUaSoSMBAIDypc1Mf56ktreV\nGzoQACgXQpkFLsUCAFQXPLGxfWlXqQFApYZLsQAAAAAcgcQOAAAAgCOQ2AEAAABwBBI7AAAA\nAI5AYgcAAADAEUjsAAAAADgCiR0AAAAARyCxAwAAAOAIJHYAAAAAHIHEDgAAAIAjGJZlWa2G\n1WQZOhIAAAAAKDmGL2JYljV0GAAAAABQBv4PC/VaugAAAARJREFUG5ymUX0DDAAAAAAASUVO\nRK5CYII="},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"markdown","source":"#### Summary of Findings\n* The regular member population is 20% larger than the casual member population. \n* The classic bike is the most commonly used by riders, followed by electric bikes, while there are only a few riders who use docked bikes.\n* Bike riders tend to ride during rush hour from 4:00 PM to 6:00 PM, with regular and casual members both using bikes to avoid traffic.\n* During the summer months of June, July, and August, the number of riders increases.\n* The stations on the list have average ride times of 90 minutes or more for the longest trips.\n* The stations on the list have recorded more than 50,000 rides, making them the ones with the highest number of rides.","metadata":{}},{"cell_type":"code","source":"install.packages(\"jpeg\")  \nlibrary(jpeg)\nsetwd(\"/kaggle/input/combine/\")\nimg <- readJPEG(\"cyclistic_viz.jpg\", native = TRUE)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Step 6: Act Phase \n\n#### Key tasks \n1. Create your portfolio. \n2. Add your case study. \n3. Practice presenting your case study to a friend or family member.\n\n#### Deliverable \nYour top three recommendations based on your analysis\n\n1. It is advisable to stock up or boost the supply of bike-related items during the peak hours for bike riders, which are between 4:00PM to 6:00PM.\n2. To ensure adequate resources at the busiest bike stations, consider redistributing resources from less active stations.\n3. As bike ridership increases during the summer months (June, July, and August), it is recommended to increase resources during this season.\n","metadata":{}},{"cell_type":"markdown","source":"## Resources","metadata":{}},{"cell_type":"markdown","source":"1. https://ride.divvybikes.com/data-license-agreement \n2. https://divvy-tripdata.s3.amazonaws.com/index.html \n3. https://sites.google.com/view/jeffransenar/welcome","metadata":{}},{"cell_type":"markdown","source":"## Reflection / Conclusion \n\n\nSulit ba ang Google Data Analytics Certificate?\n\nAs someone who comes from a counseling background, I didn't have any prior experience in programming. One day, I stumbled upon a post about Google Data Analytics and out of curiosity, I clicked on it and found myself enrolling in the program through Coursera. The enrollment fee was $14 USD or approximately P750+ per month, and I had to submit my ID for verification purposes. I officially enrolled on January 17, 2023, and completed the certification on March 18, 2023.\n\nThe certification program consisted of eight courses that introduced me to the Google Data Analysis framework such as: ask, prepare, process, analyze, share, and act. The program also taught me major technical skills, such as Spreadsheets, SQL, R programming, and Tableau. To complete the program, I had to read the materials, watch all videos, participate in discussion prompts, complete practice activities, pass all assessments (the passing grade is 80%), and culminate my learning with a case study.\n\nFor beginners, the Certification Program is worth it, as it helps you analyze real-world business data and provides exposure to the tools and environments used by data analysts, such as RStudio, Kaggle, Github, and BigQuery. It also helps you become job-ready by improving your resume, LinkedIn profile, job-hunting sites profile, and your portfolio. The program even gives tips on the data analyst hiring process, including the application, job interview, case study presentation, and contract negotiation, which can help you land a Junior Data Analyst Position.\n\nHow I survived the technical side? I survived it by first studying the Sort, Filter, and Query functions in Google Sheets, particularly the syntax of the QUERY function. While this knowledge was insufficient, it helped me understand SQL, and perhaps same with other query languages. I have found similarities of the syntax too while I'm on the data cleaning and analysis in R programming. When I get stuck on the process, I recourse on different cheat sheets, RStudio has lots of it, and of course SQL too. If I have errors on the codes, I have to rewrite it multiple times. Thanks to ChatGPT, it helped me understand and correct the code. \n\nFinally, I was able to use the ggplot2 package in R to visualize the results of my case study on Cyclistic bikeshare analysis, and here is the summary of my data viz. \n\n\n* See the Documentation: https://www.kaggle.com/code/jeffransenar/cyclistic-bikeshare/edit/run/122880838\n* See it in my Portfolio: https://sites.google.com/view/jeffransenar/welcome","metadata":{}}]}